import Card from "./components/Card"

import './App.css';

function App() {
  const [state, setState] = useState([{
    Name: "Lawrence",
    Powerlevel: 9000,
    Age: 24
  },
  {
    Name: "Lawrence",
    Powerlevel: 9000,
    Age: 24
  }]); 

  return (
    <div className="App">
     < Card values = {state}/>
    </div>
  );
}

export default App;
